function App() {
    return (
      <div style={{width:'auto', height:'auto', backgroundColor:'black'}}>

        <Layout/>

        <BrowserRouter>
          <Header />
          <Navigation />
          <Routes>
              <Route path="/" element={<shop/>} />
              <Route path="/Catalog" element={<Catalog />} />
              <Route path="/Varienty" element={<div>Гарантія</div>} />
              <Route path="/Order" element={<div>Замовити</div>} />
          </Routes>
          <Footer/>

        </BrowserRouter>


      </div>
    );
  }

  export default App;
